    /**
     * 执行签到
     * @param url 请求地址；
     * @param action 签到请求的action(qdadd)；
     * @param address 编码后的签到地址；
     * @param jd 经度；
     * @param wd 纬度；
     * @param acontent 编码后的签到图片（Base64）；
     * @return 服务器响应的数据（JSON）；
     */
    public static String sendSignPost(String url,String pid,String uid,String token,String action,String address,Integer jd,Integer wd,String acontent){
        CloseableHttpClient httpClient = HttpClients.createDefault();

        CloseableHttpResponse response = null;

        String result = null;

        HttpPost httpPost = new HttpPost(url);
        httpPost.addHeader("Connection","keep-alive");
        httpPost.addHeader("X-Requested-With","XMLHttpRequest");
        httpPost.addHeader("Content-Type","application/x-www-form-urlencoded");

        try {
            String params = "pid="+pid+"&"+"uid="+uid+"&"+"token="+token+"&"+"action="+action+"&"+"address="+address+"&"+"jd="+"108.285"+jd+"&"+"wd=22.86407"+wd+"&"+"acontent="+acontent;

            StringEntity stringEntity = new StringEntity(params);

            httpPost.setEntity(stringEntity);

            response = httpClient.execute(httpPost);

            result = EntityUtils.toString(response.getEntity(),"utf-8");

        } catch (Exception e) {
            e.printStackTrace();
        }

        return result;
    }

    /**
     * 签到结果推送到微信
     * @param content 消息内容
     */
    public static void sendSignResultToVx(String content){
        CloseableHttpClient httpClient = HttpClients.createDefault();

        HttpPost httpPost = new HttpPost("https://sc.ftqq.com/SCU137968T42f4219a1dca7a6ca926c17a76df12135fe1b7b554fe5.send");
        httpPost.addHeader("Content-Type","application/x-www-form-urlencoded");

        try {
            /** 自定义请求携带的参数*/
            String params = "text="+"---实习平台签到结果---"+"&"+"desp="+content;

            /** 将自定义的参数转成StringEntity用于让Post请求携带参数*/
            StringEntity stringEntity = new StringEntity(params);

            /** 添加请求携带的参数*/
            httpPost.setEntity(stringEntity);

            /** 发送请求*/
            httpClient.execute(httpPost);
        } catch (Exception e) {
            e.printStackTrace();
        }

    }


